import React from "react";

const EmployeeForm = () => {
  return (
    <div className="five wide column">
      <div className="ui container">
        <div className="ui padded card">
          <div className="ui form">
            <div className="field">
              <label>User Input</label>
              <input type="text" />
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default EmployeeForm;
